// SPDX-License-Identifier: GPL-3.0
pragma solidity 0.6.12;
pragma experimental ABIEncoderV2;

import './Card.sol';

contract Master is Card {
	mapping(address => string) masters;
	mapping(address => uint) created;
	function getMaster() public view returns(string memory, Servant[] memory) {
		require(keccak256(abi.encodePacked((masters[msg.sender]))) != keccak256(abi.encodePacked((""))));
		return (masters[msg.sender], drawed[msg.sender]);
	}

	function createMaster(string memory name) public {
		require(keccak256(abi.encodePacked((masters[msg.sender]))) == keccak256(abi.encodePacked((""))));
		masters[msg.sender] = name;
		created[msg.sender] = 1;
		initMaster(msg.sender);
	}
}
